Using redis to send friend status<p>I was looking around the internet to find out how I can send user status such as offline and online, etc to only friends using socket io. Some people were saying to use Redis. so I had a look and played around with it. I am also using mongodb to store friends and users.</p>

<p>This is my setup right now:</p>

<pre><code>//Status List: 
// 0 - offline
// 1 - online
// 2 - away
// 3 busy

//Set the status
redisClient.hmset ("online_status:userID", "status", "1");

//Check if someone is online
redisClient.hgetall ("online_status:userID", (err, reply) =&gt; {
  console.log(reply)
})
</code></pre>

<p>Is it fine if I use it like this to get user status? or is there a better way to do this?</p>

<p>Another question is that, is that is it fine to keep looping hgetall or is there a better way to get multiple statuses at once?</p>

