Non-blocking functional methods with Reactive Mongo and Web client<p>I have a micro service which reads objects from a database using a <code>ReactiveMongoRepository</code> interface. </p>

<p>The goal is to take each one of those objects and push it to a AWS Lambda function (after converting it to a DTO). If the result of that lambda function is in the 200 range, mark the object as being a success otherwise ignore. </p>

<p>In the old days of a simple Mongo Repository and a RestTemplate this is would be a trivial task. However I'm trying to understand this Reactive deal, and avoid blocking.  </p>

<p>Here is the code I've come up with, I know I'm blocking on the <code>webClient</code>, but how do I avoid that? </p>

<pre><code>@Override
public Flux&lt;Video&gt; index() {
    return videoRepository.findAllByIndexedIsFalse().flatMap(video -&gt; {
        final SearchDTO searchDTO = SearchDTO.builder()
                .name(video.getName())
                .canonicalPath(video.getCanonicalPath())
                .objectID(video.getObjectID())
                .userId(video.getUserId())
                .build();

        // Blocking call
        final HttpStatus httpStatus = webClient.post()
                .uri(URI.create(LAMBDA_ENDPOINT))
                .body(BodyInserters.fromObject(searchDTO)).exchange()
                .block()
                .statusCode();

        if (httpStatus.is2xxSuccessful()) {
            video.setIndexed(true);
        }

        return videoRepository.save(video);
    });
}
</code></pre>

<p>I'm calling the above from a scheduled task, and I don't really care about that actual result of the index() method, just what happens during. </p>

<pre><code>@Scheduled(fixedDelay = 60000)
public void indexTask() {
    indexService
            .index()
            .log()
            .subscribe();
}
</code></pre>

<p>I've read a bunch of blog posts etc on the subject but they're all just simple CRUD operations without anything happening in the middle so don't really give me a full picture of how to implement these things. </p>

<p>Any help? </p>

