Wrong record being deleted NodeJS + React<p>I'm building a fullstack React + NodeJS to-do list app following a tutorial. I've created a React Task component that displays info for a particular task and provides update/delete buttons. For some reason, my React updateTask and deleteTask functions update/delete the oldest task regardless of which task I've selected to change.</p>

<p>I'm using the <em>update</em> state variable in React to toggle the update form.
Also, logging <em>res</em> in the <em>updateTask</em> function returns success and the correct id to update. However, this is not the id that actually gets updated.</p>

<p>React Task component (Task.js):</p>

<pre><code>import React, { Component } from "react";
import axios from "axios";

class Task extends Component {

    constructor({_id, title, due, desc}) {
        super();
        this.state = {
            id: _id,
            title: title,
            due: due,
            desc: desc,
            update: false
        }
        this.updateTask = this.updateTask.bind(this);
        this.deleteTask = this.deleteTask.bind(this);
    }

    updateTask = () =&gt; {
        const {id, title, due, desc} = this.state;
        axios.post("/tasks/update", {
            id: id,
            update: {
                title: title,
                due: due,
                desc: desc
            }
        })
        .then(
            res =&gt; {
                console.log(res);
                console.log(res.data);
            }
        );
    };

    deleteTask = () =&gt; {
        const {id} = this.state;
        axios.delete("/tasks/delete", {
             id: id
        });
    };

    render() {
        const {id, title, due, desc, update} = this.state;
        return (
            &lt;div className="task"&gt;
                &lt;div&gt;{id}&lt;/div&gt;
                {update ? 
                &lt;div className="task-update"&gt;
                    &lt;input
                        type="text"
                        onChange={e =&gt; this.setState({ title: e.target.value })}
                        value={title}
                    /&gt;
                    &lt;input
                        type="date"
                        onChange={e =&gt; this.setState({ due: e.target.value })}
                        value={!due ? "" : due.slice(0,10)}
                    /&gt;
                    &lt;textarea
                        onChange={e =&gt; this.setState({ desc: e.target.value })}
                        value={!desc ? "" : desc}
                    /&gt;
                    &lt;button onClick={this.updateTask}&gt;
                        Update Task
                    &lt;/button&gt;
                &lt;/div&gt; 
                : 
                &lt;div className="task-show"&gt;
                    &lt;div className="task-info"&gt;
                        &lt;div&gt;{title}&lt;/div&gt;
                        &lt;div&gt;{!due ? "no date" : due.slice(0,10)}&lt;/div&gt;
                        &lt;p&gt;{desc}&lt;/p&gt;
                    &lt;/div&gt;
                    &lt;div className="task-btns"&gt;
                        &lt;button 
                            className="task-edit"
                            onClick={e =&gt; this.setState({update: true})}
                        &gt;
                        &lt;/button&gt;
                        &lt;button 
                            className="task-done"
                            onClick={() =&gt; this.doneTask()}
                        &gt;&lt;/button&gt;
                        &lt;button 
                            className="task-del"
                            onClick={this.deleteTask}
                        &gt;
                        &lt;/button&gt;
                    &lt;/div&gt;
                &lt;/div&gt;
                }
            &lt;/div&gt;
        );
    }

}

export default Task;
</code></pre>

<p>NodeJS task controller:</p>

<pre><code>var express = require('express');
var router = express.Router();
const Task = require("../models/task");
const Data = require("../models/data");

router.get("/all", (req, res) =&gt; {
  Task.find((err, tasks) =&gt; {
    if (err) return res.json({ success: false, error: err });
    return res.json({ success: true, tasks: tasks });
  });
});

router.post("/update", (req, res) =&gt; {
  const { id, update } = req.body;
  Task.findOneAndUpdate(id, update, err =&gt; {
    if (err) return res.json({ success: false, error: err });
    return res.json({ success: true, id: id});
  });
});

router.delete("/delete", (req, res) =&gt; {
  const { id } = req.body;
  Task.findOneAndDelete(id, err =&gt; {
    if (err) return res.send(err);
    return res.json({ success: true });
  });
});

router.post("/create", (req, res) =&gt; {
  let task = new Task();

  const {title, due, desc} = req.body;

  if (!title) {
    return res.json({
      success: false,
      error: "INVALID INPUTS"
    });
  }

  task.title = title;
  task.due = due;
  task.desc = desc;

  task.save(err =&gt; {
    if (err) return res.json({ success: false, error: err });
    return res.json({ success: true });
  });
});

module.exports = router;
</code></pre>

