Embed Field: How to write sum(if a>=10 and a<=100,a,0) like SQL in mongodb<p>I want to make the same SQL statement as specified <code>select sum(if a &gt;= 10 and a &lt;= 100, a, 0) from table</code> in <code>MongoDb</code>.</p>

<p>Therefore, I write:</p>

<pre><code>{
    "$project": {
        "sumqty": {
            "a1": {
                "$cond": {
                    "if": {
                        "$and": [{"$gte":["$a",10]},
                                 {"$lte":["$a",100]}]
                     },
                     "then": "$a",
                     "else": 0
                 }
             }
         }
     }
}
</code></pre>; Answer: `([^,]*)` means *"capture 0 or more characters that are not a comma"*.
So for 2 values the pattern is `([^,]*),([^,]*)`, matching "a value, then a comma, then a value". For each additional group, you'd add `,([^,]*)`.
